import { StyleSheet } from 'react-native'

export default StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center'
    },
    button: {
        width: 200,
        height: 35,
        backgroundColor: '#0f1b59',
        borderRadius: 10,
        marginTop: '8%',
    },
    buttonTitle: {
        fontSize: 16,
        color: '#f5f5f5',
        fontWeight: '700',
        textAlign: 'center',
        marginTop: 8
    },
})
